import React from 'react';


const SlotM=()=>{
    let x=':smile';
    let y=':smile';
    let z=':smile';

    if((x===y) && (y==z)){
        return(
            <>
            <div className='slot_inner'>
                <h1> {x} {y} {z} {""}</h1>
                <h1> this is matching </h1>
                <hr/>
            </div>
            </>
        )
    }else{
        return(
            <>
            <div className='slot_inner'>
                <h1> {x} {y} {z} {""}</h1>
                <h1> this is not matching </h1>
                <hr/>
            </div>
            </>
        )
    }
}

 const App=()=>
     
    ( 
 <> 
 <h1 className="heading_style"> :slot welcome to <span style={{fontWeight:400}}> slot game</span></h1>

      <SlotM/>
            </> 
 )
 
 
export default App
